import React from 'react';
const userInput = (props) => {
    return (
        <div className="input">
            <input type="text" onChange={props.changeinfo} placeholder="Enter New Name" />
            <input type="text" onChange={props.changeinfo} placeholder="Enter New Age" />
        </div>
        
    )
};
export default userInput;
